script: |
  super -f text -I q9839.spq | sort > q9839.out

inputs:
  - name: q9839.spq
    data: |
      SELECT col2 FROM tab1 (FORMAT parquet) WHERE NOT 58 IN ( - 60 * + col0 * + col0 - col0, 7 * + ( - 5 ), col0 * - + col0, - 99 );
  - name: tab1

outputs:
  - name: q9839.out
    data: |
      59
      68
      96
